import React from 'react';
import '../stylesheets/CQStats.css';

const CQStats = () => {
  const stats = {
    jobsPosted: 8,
    activeJobs: 2,
    completedJobs: 6,
    totalSpent: 12000,
  };

  return (
    <main>
      <header>
        <h1>Client Quick Stats</h1>
      </header>

      <section aria-label="Client statistics" className="stats-section">
        <article>
          <h2>Jobs Posted</h2>
          <p>{stats.jobsPosted}</p>
        </article>

        <article>
          <h2>Active Jobs</h2>
          <p>{stats.activeJobs}</p>
        </article>

        <article>
          <h2>Completed Jobs</h2>
          <p>{stats.completedJobs}</p>
        </article>

        <article>
          <h2>Total Spent</h2>
          <p>${stats.totalSpent.toLocaleString()}</p>
        </article>
      </section>
    </main>
  );
};

export default CQStats;
